        <div>
            <h2>Bem Vindo(a) {props.nome}</h2>
            <h3>Tenho {props.anos}</h3>
        </div>
    );
}

function App(){
    return(
        <div>
        <Bemvindo nome= "lucas" anos ="21"/>
        </div>
    );
}

export default App;
